const K_WIDTH = 40;
const K_HEIGHT = 40;

const userCoordStyle = {
  // initially any map object has left top corner at lat lng coordinates
  // it's on you to set object origin to 0,0 coordinates
  textAlign: 'center',
  color: 'black',
  fontSize: 16,
  fontWeight: 'bold',
};

export { userCoordStyle };
